import classes from './Card.module.css'

const Card = (props) => {

    return (
        <div className={classes.card}>
            <h3>{props.title}</h3>
            <h4>{props.location}</h4>
            <h4>{props.type}</h4>
            <h3>{props.description}</h3>
        </div>
    )

}


export default Card
